    await AppDataSource.initialize()
        .then(async () => {
            console.log('Connected to database');
            const app = express();
            app.use(compression());
            const Express = new ExpressConfig(app, Number(ENV.port) || 3000);
            await Express.init();
        })
        .catch((err) => {
            console.error('Error during Data Source initialization', err);
        });
};

// run main function
main();

